import React from 'react';
import Box from '../Box';

export default function Whats(){
    return(
        <div className='Whats'>
            <Box titulo='Victor Santos' informacao='Hey there, Im using WhatsApp'/>
            <a href='https://www.linkedin.com/in/victor-w-santos-039bba123/' target='_blank'><button>Enviar Mensagem</button></a>
        </div>
    )
}
